import React, {Component} from 'react';

const TableHeader = () => {
  return (
    <thead>
      <tr>
        <th>Name</th>
        <th>Job</th>
      </tr>
    </thead>
  )
}

// Return 1 baris tidak perlu kurung
const TableBody = () => {
  return <tbody/>
}

class Table extends Component {
  render() {
    const {characterData} = this.props;

    return (
      <table>
        <TableHeader/>
        <TableBody characterData={characterData}/>
      </table>
    )
  }
}

export default Table
